import { useEffect, useState } from "react";

export default function useDataApi() {
  const [resultData, setresultData] = useState({
    result: [],
  });

  const [isLoading, setIsLoading] = useState(false);
  const [isError, setIsError] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      const urlFetch =
        "https://s3-sa-east-1.amazonaws.com/config.instacarro.com/recruitment/auctions.json";
      setIsError(false);
      setIsLoading(true);

      try {
        const searchData = await fetch(urlFetch);
        const searchResult = await searchData.json();
        setresultData({
          result: searchResult,
        });
      } catch (error) {
        setIsError(true);
      }
      setIsLoading(false);
    };
    fetchData();
  }, []);

  return { resultData, isLoading, isError };
}
